import { combineReducers } from "redux";

const typedHouseReducer = (state = { typedHouse: 7 }, action) => {
  if (action.type !== "TYPE_OF_HOUSE") {
    return typedHouse;
  }

  switch (action.payload) {
    case "small":
      return { ...state, typedHouse: 5 };
    case "middle":
      return { ...state, typedHouse: 7 };
    case "big":
      return { ...state, typedHouse: 9 };
  }
};

export default combineReducers({
  typedHouse: typedHouseReducer
});
